##Product compositions##
Fortimel:
Milk protein concentrate, water, maltodextrin, vegetable oils, sucrose, acidity regulator (citric acid), emulsifier (soy lecithin), cocoa, flavoring (vanilla/apricot), tri-potassium citrate, choline chloride, calcium hydroxide, sodium L-ascorbate, potassium hydroxide, trisodium citrate, DL-α-tocopherol, ferrous lactate, nicotinamide, retinyl acetate, copper gluconate, manganese sulfate, zinc sulfate, sodium selenite, chromium chloride, D-calcium pantothenate, D-biotin, cholecalciferol, pyridoxine hydrochloride, pteroylmonoglutamic acid, thiamine hydrochloride, sodium fluoride, sodium molybdate, riboflavin, potassium iodide, phytomenadione.

