Demineralised water, glucose syrup, sodium molybdate, milk protein isolate, sodium fluoride, trehalose, sucrose, vegetable oils, dietary fibres (oligofructose, inulin, cellulose, resistant starch), fish oil, whey protein concentrate (from milk), tri potassium citrate, flavour, sodium chloride, tri sodium citrate, colour (E150d), flavour, magnesium hydrogen phosphate, choline chloride, carotenoids (contains soy) (b-carotene, lutein, lycopene), sodium L-ascorbate, magnesium carbonate, potassium hydroxide, taurine, DL-a-tocopheryl acetate, L-carnitine, ferrous lactate, zinc sulphate, nicotinamide, retinyl aceteate, sodium selenite, manganese sulphate, copper gluconate, pyridoxine hydrochloride, calcium D-pantothenate, pteroylmonoglutamic acid, D-biotin, chromium chloride, cholecalciferol, cyanocobalamin, thiamin hydrochloride, sodium molybdate, sodium fluoride, riboflavin, potassium iodide, phytomenadione.

##General procedure per trial##
Period	Description
warning_star	Warning for upcomming flavour stimulus using a star on the screen (2s)
taste_and_swallow	Instruction to first taste (3.5s) and then swallow (4s) the 2ml flavour stimulus
judge	Passivily judge the stimulus (22.5s) while watching a fixation cross.
rate	Actively rate the stimulus on a 7 point liking scale (self paced)
rinse	Rinsing procedure to rinse the palate using 2ml of a 5% artificial saliva solution (29s)

##Stimulus labels##
All stimulus screens (except "warning_star" and "rinse") are coded as a combination of the general procedure and Flavour product as follows:

